import React from "react";
import ReactDOM from "react-dom";
import Heading from "./heading";
import Note from "./Note";
import Footer from "./Footer"
import Allnotes from "../Allnotes"
import {useState} from "react";

function createNote(prop)
{
  return (
    <Note
   title={prop.title}
   content={prop.content}
    />

  );
}

function App()
{
  var shaam="sandas";
  var [naam,changestate]=useState(shaam);
  function clicked()
  {
    changestate(naam+"s");
  }

  return (<div><Heading />
    {Allnotes.map(createNote)}
    <Footer />
    {naam}
    <br />
    <button type="button" onclick={clicked}>click click click</button>
    </div>);

}
export default App;
